import React, { useEffect, useState } from 'react';
import fetch from 'node-fetch'

function HomePage() {
  const [data, setData] = useState([])

  useEffect(() => {
    fetch('http://localhost:3001/users/all')
    .then(res => {
      return res.json()
    })
    .then(result => {

      if (result.error) {
        console.log("there is an erorr")
        throw result.error
      } 
      setData(result)
    })
    .catch(err => {
      setData([err.error])
    })

  }, []);

  return (
  <div>
    Welcome to Next.js!
    <list>

      { 
      data.map(item => {
      console.log(item)
      return <li key={Math.random()}>
        <strong>User: </strong>{item.user_name}
      </li>
    })} 
    </list>
  </div>
  )
}

export default HomePage
